import { Link } from "react-router-dom";
import Clock from "./Clock";
import Container from "react-bootstrap/Container";
import { Button } from "react-bootstrap";

const Welcome = () => {
  return (
    <Container className="d-flex flex-column align-items- justify-content-center">
      <Clock />
      <Button>
        <Link to="/izin/add" style={{ color: "white", textDecoration: "none" }}>
          Izin Sekarang!
        </Link>{" "}
      </Button>
    </Container>
  );
};

export default Welcome;
